import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container } from "react-bootstrap";




export default class Leaderboard extends React.Component {


  render() {
    return (
      <div className="jumbotron m-auto d-flex justify-content-center">
        <Container>
            <div className="form-group mx-auto">
                <label htmlFor="value">Principal</label>
                <input type="number" className="form-control" id="value" aria-describedby="value" placeholder="Enter value" />

                <label htmlFor="years">Years</label>
                <input type="number" className="form-control" id="years" aria-describedby="years" placeholder="Enter years" />

                <label htmlFor="rate">Rate (%)</label>
                <input type="number" className="form-control" id="rate" aria-describedby="rate" placeholder="Enter rate" />

            </div>
            <div className="text-end"><button type="submit" onClick={this.calculate} className="btn btn-primary">Submit</button></div>

            <div className="h1">${this.result}</div>
        </Container>
      </div>
    );
  }
}
